# @param {String} s
# @return {Integer}

# ok, only 5%
def length_of_longest_substring(s)
  max_length = 0
  schars = s.chars
  catch :longest do
    max_slice = [s.length, 95].min # 128? 95?
    (max_slice).downto(1) do |slice_length|
      schars.each_cons(slice_length) do |slice|
        if slice.length == slice.uniq.length
          max_length = slice.length
          throw :longest
        end
      end
    end
  end
  return max_length
end

e0 = "abcde"
r0 = length_of_longest_substring(e0)
puts r0
puts r0 == 5

e1 = "abcabcbb"
r1 = length_of_longest_substring(e1)
# Explanation: The answer is "abc", with the length of 3.
puts r1
puts r1 == 3

e2 = "bbbbb"
r2 = length_of_longest_substring(e2)
# Explanation: The answer is "b", with the length of 1.
puts r2
puts r2 == 1

e3 = "pwwkew"
r3 = length_of_longest_substring(e3)
# Explanation: The answer is "wke", with the length of 3.
# Notice that the answer must be a substring, "pwke" is a subsequence and not a substring.
puts r3
puts r3 == 3

e4 = "aab"
r4 = length_of_longest_substring(e4)
puts r4
puts r4 == 2

